import React from 'react'

export default function Footer() {
  return (
    <footer className="footer">
      <div className="content has-text-centered">
        <p>
           Bản quyền thuộc về <span className="tag is-primary">Nhóm 10</span> - Hồ Duy Hoàng - Đàm Vinh Quang - Nguyễn Quốc Huy - Xây dựng ứng dụng quản lý sinh viên serverless.
        </p>
      </div>
    </footer>
  )
}
